INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES (3001, "2024/10/31 12:00:00", -416.5, 130011, "2030/01/01 14:59:59", 100, 3001100, "ヤマト", 1, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 2.1, 0.0, 2);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES (3001, "2024/10/31 12:00:00", -416.5, 130011, "2030/01/01 14:59:59", 101, 3001101, "ヤマト", 4, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 5.68, 0.0, 2);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES (3001, "2024/10/31 12:00:00", -416.5, 130011, "2030/01/01 14:59:59", 102, 3001102, "ヤマト", 1, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", 0.0, 0.0, 1);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES (3002, "2024/10/31 12:00:00", -416.5, 130211, "2030/01/01 14:59:59", 100, 3002100, "フブキ", 1, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 0.0, 0.0, 1);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES (3002, "2024/10/31 12:00:00", -416.5, 130211, "2030/01/01 14:59:59", 101, 3002101, "フブキ", 1, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", 0.0, 0.0, 1);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES (3002, "2024/10/31 12:00:00", -416.5, 130211, "2030/01/01 14:59:59", 102, 3002102, "フブキ", 5, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", 8.53, 0.0, 2);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES (3002, "2024/10/31 12:00:00", -416.5, 130211, "2030/01/01 14:59:59", 103, 3002103, "フブキ", 7, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", 5.67, 0.0, 1);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES (3002, "2024/10/31 12:00:00", -416.5, 130211, "2030/01/01 14:59:59", 104, 3002104, "フブキ", 1, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", 0.0, 0.0, 1);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES (3004, "2024/10/31 12:00:00", -416.5, 130211, "2030/01/01 14:59:59", 300, 3002300, "フブキ", 3, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", 0.0, 0.0, 3);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES (3005, "2024/10/31 12:00:00", -416.5, 130211, "2030/01/01 14:59:59", 301, 3002400, "フブキ", 7, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", 0.0, 0.0, 7);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES (3003, "2024/10/31 12:00:00", -416.5, 130211, "2030/01/01 14:59:59", 200, 3003200, "フブキ", 2, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", 4.4, 0.0, 1);
INSERT INTO `v1_14c639bd64f9b903bbdc54d2e0483c90020dcaf47248447e0780ec32ad5eed1c` VALUES (3003, "2024/10/31 12:00:00", -416.5, 130211, "2030/01/01 14:59:59", 201, 3003201, "フブキ", 7, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", 0.0, 0.0, 7);
